import React, { Component } from 'react'
import { Card, Button, Table, Space, Divider } from 'antd'
import {
    PlusOutlined
} from '@ant-design/icons';
import LinkButton from '../../../components/LinkButton';

export default class CarriageInfo extends Component {
    render() {
        const columns = [
            {
                title: '车厢序号',
                dataIndex: 'carriageOrder',
                key: '1',
                align: 'center',
            },
            {
                title: '车厢编号',
                dataIndex: 'carriageNumber',
                key: '2',
                align: 'center',
            },
            {
                title: '类别',
                dataIndex: 'type',
                key: '3',
                align: 'center',
            },
            {
                title: '座位数',
                dataIndex: 'seatNumber',
                key: '4',
                align: 'center',
            },
            {
                title: '价格基数',
                dataIndex: 'priceBase',
                key: '5',
                align: 'center',
            },
            {
                title: '操作',
                key: '6',
                align: 'center',
                render: () => (
                    <Space size="middle">
                        <LinkButton >下移</LinkButton>
                        <LinkButton >上移</LinkButton>
                        <LinkButton >删除</LinkButton>
                    </Space>
                )
            }
        ];

        const data = [
            {
                key: '1',
                number: 1,
                end: '成都',
                useTime: 8,
            },
            {
                key: '2',
                number: 1,
                end: '北京',
                useTime: 7,
            },
        ]

        return (
            <div>
                <div>
                    <Card
                        title={<Divider orientation="left" plain>
                            <Button shape='round'>车厢信息</Button>
                        </Divider>}
                        size='small'
                        extra={<Button icon={<PlusOutlined />} type="primary" style={{ marginRight: '20px' }}></Button>}
                    >
                        <Table
                            columns={columns}
                            dataSource={data}
                            bordered
                            rowKey="key"
                            pagination={false}
                        />
                    </Card>
                </div>
            </div>
        )
    }
}
